pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract SilverRaptor is ERC721 {
    address public owner;

    event RaptorMinted(address indexed _recipient, uint8 _tokenId);

    constructor() public ERC721("SilverRaptor", "SRAP") {
        owner = msg.sender;
        _setBaseURI("ipfs://");
    }

    modifier restricted() {
        if (msg.sender == owner) _;
    }

    function mintRaptor(
        address _recipient,
        uint8 _tokenId,
        string memory _tokenURI
    ) public restricted {
        _mint(_recipient, _tokenId);
        _setTokenURI(_tokenId, _tokenURI);
        emit RaptorMinted(_recipient, _tokenId);
    }
}
